import React, { useState } from 'react';

function DoctorForm() {
  // Inline styles for the form container and elements
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundImage: 'url(images/Doctro.jpg)', // Add your image path here
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    position: 'relative',
    animation: 'fadeIn 2s ease-out', // Animation for fading in the container
  };

  const formStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '16px', // Added gap for better spacing
    maxWidth: '400px',  // Reduced width for a more compact form
    width: '90%',
    padding: '20px',
    backgroundColor: 'rgba(255, 255, 255, 0.85)', // Semi-transparent white background
    borderRadius: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    position: 'relative',
    zIndex: '2',
    animation: 'slideUp 1s ease-out', // Slide-up animation for the form
  };

  const overlayStyle = {
    content: '""',
    position: 'absolute',
    top: '0',
    left: '0',
    right: '0',
    bottom: '0',
    backgroundColor: 'rgba(0, 0, 0, 0.4)', // Dark overlay with transparency
    zIndex: '0',
  };

  const labelStyle = {
    fontSize: '14px',
    fontWeight: '500',
    marginBottom: '8px',
  };

  const inputStyle = {
    padding: '12px',
    border: '1px solid #ddd',
    borderRadius: '6px',
    fontSize: '14px',  // Reduced font size for better fit
    transition: 'border-color 0.3s ease-in-out',
  };

  const selectStyle = {
    ...inputStyle,
  };

  const buttonStyle = {
    backgroundColor: '#41928e',
    color: 'white',
    border: 'none',
    padding: '12px',
    borderRadius: '6px',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease, transform 0.3s ease',
    fontSize: '14px',  // Reduced font size for the button
  };

  const [buttonHover, setButtonHover] = useState(false);

  const hoverStyle = buttonHover ? { backgroundColor: '#0056b3', transform: 'scale(1.05)' } : {};

  const handleMouseEnter = () => {
    setButtonHover(true);
  };

  const handleMouseLeave = () => {
    setButtonHover(false);
  };

  return (
    <div style={containerStyle}>
      <div style={overlayStyle}></div>
      <h2 style={{ color: '#110f24', position: 'relative', marginTop: '35px', zIndex: 3, fontFamily: 'Arial, sans-serif', fontWeight: 'bold', fontSize: '24px' }}>Doctor Registration</h2>
      <form style={formStyle}>
        <label style={labelStyle}>
          Full Name:
          <input type="text" name="fullName" required style={inputStyle} />
        </label>
        
        <label style={labelStyle}>
          Email:
          <input type="email" name="email" required style={inputStyle} />
        </label>

        <label style={labelStyle}>
          Password:
          <input type="password" name="password" required style={inputStyle} />
        </label>

        <label style={labelStyle}>
          Mobile Number:
          <input type="tel" name="mobileNumber" required style={inputStyle} />
        </label>

        <label style={labelStyle}>
          Profession (e.g., Dentist, Surgeon):
          <input type="text" name="profession" required style={inputStyle} />
        </label>

        <label style={labelStyle}>
          License Number:
          <input type="text" name="licenseNumber" required style={inputStyle} />
        </label>

        <label style={labelStyle}>
          Gender:
          <select name="gender" required style={selectStyle}>
            <option value="">Select</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="transgender">Transgender</option>
          </select>
        </label>

        <button
          type="submit"
          style={{ ...buttonStyle, ...hoverStyle }}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        >
          Register
        </button>
      </form>
      
    </div>
  );
}

export default DoctorForm;
